  input: '"TEXT","F3XA",,"With regard to the PAC''s administrative expenses, America''s
    Majority Trust retains a law firm to administer the PAC.  The firm''s services
    include record-keeping, check writing, and preparation of the FEC reports.  So
    the retainer includes those normal administrative expenses to which you refer.  Also,
    because the firm houses all the PAC''s records, the PAC does not need an office.  The
    PAC pays the firm when it receives a bill.  With regard to the petty cash entries,
    those were memo entries and were not included in the totals.  In April, the PAC
    disbursed $100.00 for petty cash but the entry was not itemized because of the
    amount.  The expenditures memoed on this report were paid for with the petty cash
    that was disbursed in April. As for the American Express memoed entry, again,
    the disbursment to American Express was for the same amount as the memo entry
    and thus was not itemized."'
